import React, { useState } from "react";
import FlowerNav from "./render/FlowerNav";
import { FlowerMainPage } from "./render/FlowerMainPage";
import { CartItemsContext } from "../context/CartContext";
import { FlowerFooter } from "./render/FlowerFooter";

export const FlowersRenderComponent = () => {
  let [value, setValue] = useState();

  return (
    <CartItemsContext.Provider value={{ value, setValue }}>
      <FlowerNav />
      <main>
        <FlowerMainPage />
      </main>
      <FlowerFooter />
    </CartItemsContext.Provider>
  );
};
